INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (44, 155, 2, "A", 16, 27, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "人助けが大好き！　前向き格闘娘", "ヒヨリ", "トゥインクルウィッシュ", "東山奈央", 100101, 8, "獣人族", 0, "人助け、応援");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (47, 158, 2, "O", 17, 5, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "戦闘のサポートが得意な、心優しい少女", "ユイ", "トゥインクルウィッシュ", "種田梨沙", 100201, 4, "ヒューマン", 0, "料理、人間観察");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (46, 163, 2, "B", 18, 12, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "クールで何事にも真っ直ぐな剣士", "レイ", "トゥインクルウィッシュ", "早見沙織", 100301, 1, "魔族", 0, "読書、乗馬、お茶");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (27, 128, 5, "O", 9, 10, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", "探検好きのイタズラっ子", "ミソギ", "リトルリリカル", "諸星すみれ", 100401, 8, "ヒューマン", 0, "いたずら、探検");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (40, 146, 8, "O", 12, 25, "？？？", "ヒーローに憧れる騎士見習いの少女", "マツリ", "王宮騎士団（NIGHTMARE）", "下田麻美", 100501, 11, "獣人族", 0, "ヒーローごっこ");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (42, 150, 7, "O", 13, 22, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", "甘え上手なみんなの人気者", "アカリ", "悪魔偽王国軍（ディアボロス）", "浅倉杏美", 100601, 11, "魔族", 0, "サックス");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (32, 130, 7, "B", 14, 23, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "プリン大好きゴースト娘", "ミヤコ", "悪魔偽王国軍（ディアボロス）", "雨宮天", 100701, 1, "魔族", 0, "プリンを食べること");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (40, 150, 15, "AB", 14, 10, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", "ボクは誰よりも美しい", "ユキ", "ヴァイスフリューゲル　ランドソル支部", "大空直美", 100801, 10, "エルフ", 0, "鏡で自分を見ること");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (45, 159, 13, "A", 17, 5, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", "前世を信じる中二病患者、「疾風の冥姫」", "アンナ", "トワイライトキャラバン", "髙野麻美", 100901, 7, "魔族", 0, "小説執筆");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (42, 155, 10, "O", 16, 22, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", "マホマホ王国のプリンセス", "マホ", "自警団（カォン）", "内田真礼", 101001, 9, "獣人族", 0, "空想、ぬいぐるみ集め");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (44, 156, 3, "A", 15, 25, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", "人懐っこくてマシンガントークな妹系少女", "リノ", "ラビリンス", "阿澄佳奈", 101101, 8, "ヒューマン", 0, "お裁縫");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (46, 156, 6, "A", 17, 24, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", "みんなのために超能力を使う眠り姫", "ハツネ", "フォレスティエ", "大橋彩香", 101201, 12, "エルフ", 0, "妹と遊ぶこと、二度寝、昼寝、早寝");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (55, 166, 13, "O", 18, 21, "", "オタク全開な魔法少女", "ナナカ", "トワイライトキャラバン", "佳村はるか", 101301, 8, "魔族", 0, "読書、魔法");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (41, 152, 10, "AB", 15, 3, "test", "頭脳明晰な美少女名探偵", "カスミ", "自警団（カォン）", "水瀬いのり", 101401, 11, "獣人族", 0, "読書、推理");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (54, 165, 6, "O", 21, 5, "test", "母性溢れる優しいみんなの「ミサト先生」", "ミサト", "フォレスティエ", "國府田マリ子", 101501, 9, "エルフ", 0, "絵本作り");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (48, 167, 14, "O", 17, 10, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", "天真爛漫で人気者のカリスマモデル", "スズナ", "ルーセント学院", "上坂すみれ", 101601, 4, "魔族", 0, "ファッション");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (53, 158, 10, "A", 17, 7, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", "いつでも「なんくるないさ～」な天然娘", "カオリ", "自警団（カォン）", "高森奈津美", 101701, 7, "獣人族", 0, "踊り、空手");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (52, 162, 14, "B", 23, 14, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", "多くの男性を魅了する無垢な女教師", "イオ", "ルーセント学院", "伊藤静", 101801, 8, "魔族", 0, "恋愛小説、恋愛舞台、恋愛漫画の鑑賞");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (21, 117, 5, "O", 10, 3, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", "お歌もにんじんも、ウサギさんも大好き♪", "ミミ", "リトルリリカル", "日高里菜", 102001, 4, "獣人族", 0, "かわいいもの集め");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (40, 150, 9, "B", 12, 9, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "泣き虫で臆病な守ってあげたい女の子", "クルミ", "サレンディア救護院", "植田佳奈", 102101, 6, "ヒューマン", 0, "観劇、おままごと");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (40, 150, 7, "O", 13, 22, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", "人見知りであまのじゃくな女の子", "ヨリ", "悪魔偽王国軍（ディアボロス）", "原紗友里", 102201, 11, "魔族", 0, "ゲーム全般");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (38, 148, 9, "B", 14, 10, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "ぷうきちといつも一緒！", "アヤネ", "サレンディア救護院", "芹澤優", 102301, 5, "ヒューマン", 0, "屋内でできる遊び");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (43, 154, 9, "O", 15, 12, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", "お嬢さまのためにがんばるドジっ娘メイド", "スズメ", "サレンディア救護院", "悠木碧", 102501, 12, "ヒューマン", 0, "ご奉仕");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (42, 144, 11, "B", 17, 1, "test", "遊びと睡眠が何より大事なぐうたら娘", "リン", "牧場（エリザベスパーク）", "小岩井ことり", 102601, 1, "獣人族", 0, "あんパン");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (43, 154, 13, "B", 16, 30, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "運命の相手に一途すぎる乙女", "エリコ", "トワイライトキャラバン", "橋本ちなみ", 102701, 7, "魔族", 0, "実験、裁縫、料理");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (43, 156, 9, "A", 17, 4, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", "救護院を経営する優しい庶民派お嬢様", "サレン", "サレンディア救護院", "堀江由衣", 102801, 10, "エルフ", 0, "経営、お茶会");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (40, 157, 4, "B", 17, 24, "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", "歌って踊れる大人気アイドル", "ノゾミ", "カルミナ", "日笠陽子", 102901, 1, "ヒューマン", 0, "舞台鑑賞、ダンス");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (51, 163, 15, "O", 16, 31, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", "トーゴクの神秘、オシエテクダサイ！", "ニノン", "ヴァイスフリューゲル　ランドソル支部", "佐藤聡美", 103001, 8, "ヒューマン", 0, "忍法開発");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (42, 157, 7, "AB", 18, 22, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "占いが得意な霊能少女", "シノブ", "悪魔偽王国軍（ディアボロス）", "大坪由佳", 103101, 12, "魔族", 0, "占い");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (45, 157, 12, "AB", 18, 12, "この私とともにいる限り、\nお金に不自由はさせませんわ！", "一人前の商人を目指すパワフルお嬢様", "アキノ", "メルクリウス財団", "松嵜麗", 103201, 3, "ヒューマン", 0, "慈善事業");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (35, 142, 11, "B", 20, 3, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", "みんなを笑顔にするお笑い牧場主", "マヒル", "牧場（エリザベスパーク）", "新田恵海", 103301, 3, "ヒューマン", 0, "漫才");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (55, 164, 12, "A", 22, 16, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", "純情でほっとけない大人の女性", "ユカリ", "メルクリウス財団", "今井麻美", 103401, 3, "エルフ", 0, "ウインドーショッピング");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (21, 118, 5, "A", 8, 2, "test", "礼儀正しくしっかり者のちびっ子優等生", "キョウカ", "リトルリリカル", "小倉唯", 103601, 2, "エルフ", 0, "お勉強");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (43, 149, 8, "A", 13, 11, "test", "義理堅くてからかい好きな剣術少女", "トモ", "王宮騎士団（NIGHTMARE）", "茅原実里", 103701, 8, "ヒューマン", 0, "剣術、年長者をからかう");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (40, 153, 11, "A", 14, 3, "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", "読書が趣味の病弱少女", "シオリ", "牧場（エリザベスパーク）", "小清水亜美", 103801, 11, "獣人族", 0, "読書、お散歩");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (44, 158, 6, "AB", 13, 6, "友達ができるその日まで…\nBB団で\nトレーニングですっ！", "「友達」に憧れる、エルフの森の女の子", "アオイ", "フォレスティエ", "花澤香菜", 104001, 6, "エルフ", 0, "友達作りのイメトレ");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (46, 163, 4, "O", 17, 3, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "人々を守るために歌う、唱喚士の少女", "チカ", "カルミナ", "福原綾香", 104201, 6, "ヒューマン", 0, "各種楽器");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (54, 168, 10, "O", 17, 9, "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", "男勝りで情に厚いワイルド娘", "マコト", "自警団（カォン）", "小松未可子", 104301, 8, "獣人族", 0, "お菓子作り");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (50, 172, 7, "A", "??", 5, "test", "かつては夜を支配した最強の吸血鬼", "イリヤ", "悪魔偽王国軍（ディアボロス）", "丹下桜", 104401, 5, "魔族", 0, "世界征服");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (49, 157, 15, "AB", 18, 19, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", "妄想大好き！　ほんとは照れ屋な女の子", "クウカ", "ヴァイスフリューゲル　ランドソル支部", "長妻樹里", 104501, 11, "ヒューマン", 0, "小説を読むこと");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (48, 158, 12, "AB", 19, 1, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "弱きを助け強きをくじく猫娘", "タマキ", "メルクリウス財団", "沼倉愛美", 104601, 3, "獣人族", 0, "猫とたわむれること");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (50, 171, 8, "A", 25, 25, "？？？", "素顔を見せない冷静沈着な女性騎士", "ジュン", "王宮騎士団（NIGHTMARE）", "川澄綾子", 104701, 10, "ヒューマン", 0, "格闘技、湯浴み");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (49, 163, 12, "O", 20, 11, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "仕事も私事も効率優先な傭兵少女", "ミフユ", "メルクリウス財団", "田所あずさ", 104801, 11, "ヒューマン", 0, "傭兵などのアルバイト");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (54, 168, 3, "O", 18, 24, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", "お姉ちゃんがお世話してあげるからねっ！", "シズル", "ラビリンス", "生天目仁美", 104901, 10, "ヒューマン", 0, "家事全般");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (22, 120, 14, "A", 11, 3, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "ちょっとおませな恋に恋する女の子", "ミサキ", "ルーセント学院", "久野美咲", 105001, 1, "魔族", 0, "ファッション誌鑑賞、コスメ集め");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (53, 166, 13, "A", 27, 7, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", "実験が趣味の危険な科学者", "ミツキ", "トワイライトキャラバン", "三石琴乃", 105101, 3, "ヒューマン", 0, "研究、実験");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (100, 150, 11, "A", 17, 14, "私、ごく普通の、どこにでもいる女の子よ！\nみ、見た目以外はね…", "乙女チックなもふもふアニマル", "リマ", "牧場（エリザベスパーク）", "徳井青空", 105201, 3, "獣人族", 0, "毛繕い、お喋り");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (33, 140, 15, "A", 17, 28, "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！", "見た目も中身もお子ちゃまな異国の軍人", "モニカ", "ヴァイスフリューゲル　ランドソル支部", "辻あゆみ", 105301, 7, "ヒューマン", 0, "お菓子屋通い");
