INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (45, 156, "", "O", 17, 10, "私ね、一人前の騎空士になりたいんだ\nいつか父さんみたいな騎空士になって、\n空の果てまで旅する。それが私の夢だよ！", "空への冒険を夢見る騎空士の少女", "ジータ", "？？？", "金元寿子", 105701, 3, "ヒューマン", 0, "冒険、おしゃべり");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (46, 156, 1, "O", 17, 31, "あ、あの…何か食べ物持っていませんか？\nもう、お腹ペコペコで…", "いつも元気な腹ペコ少女", "ペコリーヌ", "美食殿", "M・A・O", 105801, 3, "ヒューマン", 0, "食べ歩き、料理");
