INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (43, 154, 9, "O", 15, 12, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", "お嬢さまのためにがんばるドジっ娘メイド", "スズメ（サマー）", "サレンディア救護院", "悠木碧", 107701, 12, "ヒューマン", 0, "ご奉仕");
