INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (48, 158, 12, "AB", 19, 1, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "弱きを助け強きをくじく猫娘", "タマキ（サマー）", "メルクリウス財団", "沼倉愛美", 107901, 3, "獣人族", 0, "猫とたわむれること");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (49, 163, 12, "O", 20, 11, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "仕事も私事も効率優先な傭兵少女", "ミフユ（サマー）", "メルクリウス財団", "田所あずさ", 108001, 11, "ヒューマン", 0, "傭兵などのアルバイト");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (42, 157, 7, "AB", 18, 22, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "占いが得意な霊能少女", "シノブ（ハロウィン）", "悪魔偽王国軍（ディアボロス）", "大坪由佳", 108101, 12, "魔族", 0, "占い");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (32, 130, 7, "B", 14, 23, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "プリン大好きゴースト娘", "ミヤコ（ハロウィン）", "悪魔偽王国軍（ディアボロス）", "雨宮天", 108201, 1, "魔族", 0, "プリンを食べること");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (22, 120, 14, "A", 11, 3, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "ちょっとおませな恋に恋する女の子", "ミサキ（ハロウィン）", "ルーセント学院", "久野美咲", 108301, 1, "魔族", 0, "ファッション誌鑑賞、コスメ集め");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (46, 163, 4, "O", 17, 3, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "人々を守るために歌う、唱喚士の少女", "チカ（クリスマス）", "カルミナ", "福原綾香", 108401, 6, "ヒューマン", 0, "各種楽器");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (40, 150, 9, "B", 12, 9, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "泣き虫で臆病な守ってあげたい女の子", "クルミ（クリスマス）", "サレンディア救護院", "植田佳奈", 108501, 6, "ヒューマン", 0, "観劇、おままごと");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (38, 148, 9, "B", 14, 10, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "ぷうきちといつも一緒！", "アヤネ（クリスマス）", "サレンディア救護院", "芹澤優", 108601, 5, "ヒューマン", 0, "屋内でできる遊び");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (44, 155, 2, "A", 16, 27, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "人助けが大好き！　前向き格闘娘", "ヒヨリ（ニューイヤー）", "トゥインクルウィッシュ", "東山奈央", 108701, 8, "獣人族", 0, "人助け、応援");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (47, 158, 2, "O", 17, 5, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "戦闘のサポートが得意な、心優しい少女", "ユイ（ニューイヤー）", "トゥインクルウィッシュ", "種田梨沙", 108801, 4, "ヒューマン", 0, "料理、人間観察");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (46, 163, 2, "B", 18, 12, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "クールで何事にも真っ直ぐな剣士", "レイ（ニューイヤー）", "トゥインクルウィッシュ", "早見沙織", 108901, 1, "魔族", 0, "読書、乗馬、お茶");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (43, 154, 13, "B", 16, 30, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "運命の相手に一途すぎる乙女", "エリコ（バレンタイン）", "トワイライトキャラバン", "橋本ちなみ", 109001, 7, "魔族", 0, "実験、裁縫、料理");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (54, 168, 3, "O", 18, 24, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", "お姉ちゃんがお世話してあげるからねっ！", "シズル（バレンタイン）", "ラビリンス", "生天目仁美", 109101, 10, "ヒューマン", 0, "家事全般");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (55, 156, "", "AB", 17, 1, "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", "英霊と契約を結んだマナリアの天才王女", "アン", "？？？", "日笠陽子", 109201, 12, "ヒューマン", 0, "読書");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (45, 144, "", "O", 16, 4, "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", "マナリア魔法学院の新入生", "ルゥ", "？？？", "こやまきみこ", 109301, 2, "ヒューマン", 0, "食べること、眠ること");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (67, 167, "", "B", 17, 3, "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね", "人を超越した力を有す心優しい竜姫", "グレア", "？？？", "福原綾香", 109401, 11, "半人半竜", 0, "ピアノ");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (49, 157, 15, "AB", 18, 19, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", "妄想大好き！　ほんとは照れ屋な女の子", "クウカ（オーエド）", "ヴァイスフリューゲル　ランドソル支部", "長妻樹里", 109501, 11, "ヒューマン", 0, "小説を読むこと");
