INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (43, 154, 13, "B", 16, 30, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "運命の相手に一途すぎる乙女", "エリコ（サマー）", "トワイライトキャラバン", "橋本ちなみ", 117001, 7, "魔族", 0, "実験、裁縫、料理");
