INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (45, 159, 13, "A", 17, 5, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", "前世を信じる中二病患者、「疾風の冥姫」", "アンナ（パイレーツ）", "トワイライトキャラバン", "髙野麻美", 121901, 7, "魔族", 0, "小説執筆");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (42, 157, 7, "AB", 18, 22, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "占いが得意な霊能少女", "シノブ（パイレーツ）", "悪魔偽王国軍（ディアボロス）", "大坪由佳", 122001, 12, "魔族", 0, "占い");
