INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (41, 149, "", "AB", "??", 6, "", "けんぞくのご主人様", "ヴァンピィ", "？？？", "釘宮理恵", 122301, 12, "魔族", 0, "お散歩、お料理");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (44, 155, 2, "A", 16, 27, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "人助けが大好き！　前向き格闘娘", "ヒヨリ（サマー）", "トゥインクルウィッシュ", "東山奈央", 122401, 8, "獣人族", 0, "人助け、応援");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (46, 163, 2, "B", 18, 12, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "クールで何事にも真っ直ぐな剣士", "レイ（サマー）", "トゥインクルウィッシュ", "早見沙織", 122501, 1, "魔族", 0, "読書、乗馬、お茶");
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (47, 158, 2, "O", 17, 5, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "戦闘のサポートが得意な、心優しい少女", "ユイ（サマー）", "トゥインクルウィッシュ", "種田梨沙", 122601, 4, "ヒューマン", 0, "料理、人間観察");
